import React from 'react';

const TrainerCard = (props) => {
  return (
    <>
         <div className="box" id="andre">
          <img src={props.image} alt="" />
          <div className="info">
          </div>
          <div className="Trainer-overlay">
            <div className="overlay-content">
              
            </div>
            <h3>{props.name}</h3>

          </div>
        </div>
    </>
  );
}

export default TrainerCard;
